import React from "react"
import { List } from "antd"
function TopicsList(){
    return (
        <List 
        loading={false}
        dataSource={[1,2,3]}
        renderItem={(data)=>{
            return <List.Item>
                {data}
            </List.Item>
        }}
        />
    )
}
export default TopicsList;
